function logResult(n){console.log(n)}function logError(n){console.error("Hata: \n",n);alert("Hata"+n)}function readResponseAsJSON(n){return n.json()}function validateResponse(n){if(!n.ok)throw Error(n.statusText);return n}function deleteJSON(n,t){fetch(n,{method:"DELETE",headers:jsonHeaders}).then(validateResponse).then(readResponseAsJSON).then(t).catch(logError)}function getJSON(n,t){fetch(n,{method:"GET",headers:jsonHeaders}).then(validateResponse).then(readResponseAsJSON).then(t).catch(logError)}function postJSON(n,t,i){fetch(n,{method:"POST",headers:jsonHeaders,body:JSON.stringify(t)}).then(validateResponse).then(readResponseAsJSON).then(i).catch(logError)}function putJSON(n,t,i){fetch(n,{method:"PUT",headers:jsonHeaders,body:JSON.stringify(t)}).then(validateResponse).then(readResponseAsJSON).then(i).catch(logError)}const jsonHeaders=new Headers({Accept:"application/json","Content-Type":"application/json"});